import React from 'react';
import s from './Login.module.css'
import Input from "../CreateAd/Input/Input";

const Login = () => {
  return (
      <div className={s.login}>
        <div className={s.login__content}>
          <span>Логин</span>
          <input className={s.login__input} placeholder={'Имя пользователя или email'} type="text"/>
        </div>
      </div>
  );
};

export default Login;
